Kara Thompson is the lead artist for the Grays #T100Calling event, Spring Clean. For their mandala, they will be using plastic taken from the Thames by local litter picking groups and turning it into a magnificent masterpiece, highlighting plastic pollution and working closely with @thames21 ♻️

Thames21 is one of the leading waterways charities in the country,  working hard with volunteers to clean up the 400-mile long Thames. They are passionate about cleaning up the UK's rivers and lakes, like clearing litter from riverbeds and introducing reedbeds to tackle pollution 🌊

